import PublicRoute from "../utils/PublicRoute.js";

const Work = () => {
  const content = (
    <>
      <svg width="32" height="32">
        <circle
          cx="50"
          cy="50"
          r="40"
          stroke="#128482"
          stroke-width="14"
          fill="#d0491e"
        />
      </svg>
    </>
  );

  return <PublicRoute title="work" content={content} />;
};

export default Work;
